import React from 'react';
import { SectionsContainer, Section } from 'react-fullpage';
import "../Style/LayOut.css";
import { Container1, Container1Inner, Container2 } from '../StyleComponents/StyleComponent';
import profile from "../img/profile.png";
import { Link } from 'react-router-dom';
function Layout(props) {

    let options = {
        anchors: ['sectionOne', 'sectionTwo', 'sectionThree'],
        navigation: false,
        // delay: 1000,
    };


    return (
        <SectionsContainer {...options}>
            <Section>
                <Container1>
                    <Container1Inner>
                        <span className='InfoSpan1'>Lee Sang Hyuk</span>
                        <span className='InfoSpan2'>FRONT-END DEVLOPER</span>
                        <div>
                        <a href='https://github.com/helloa1109' target='_blank' rel='noopener noreferrer'>GitHub</a>
                        <a href='https://github.com/helloa1109' target='_blank' rel='noopener noreferrer'>Notion</a>
                        </div>
                    </Container1Inner>
                </Container1>
            </Section>

            <Section>
                <Container2>
                    <span>섹션2</span>
                </Container2>
            </Section>

            <Section>
                Page 3
            </Section>
        </SectionsContainer>
    );
}

export default Layout;
